import React from "react";
import {Route, Switch} from "react-router-dom";
import App from "./App";
import CreateNote from "./CreateNote";
import Note from "./Note";
import Error from "./Error";
import Menu from "./Menu";
import User from "./User";

const Home = () =>{

 

return(
    <>
    <div className="box_center">
    <Menu/></div>

    <div className="box_center" style={{ marginTop:"40px"}}>

    
    <Switch>
    <Route exact path="/" component={()=><Error name="Mainpage"/>} />
    <Route path="/1" component={CreateNote} />
    <Route path="/2" component={Note}/>
    <Route exact path="/3" render={()=><Error rendname=" Render page"/>} />
    <Route path="/4/:fname" component={User} />
    <Route component={Error}/>
    </Switch> 
    </div>     
    </>
);
}
export default Home;
